SQL_STMT_U.val:
/*Geef de ketens waarvoor een arrangementsprovisie aanwezig welke ook al is geboekt */
Select distinct decode (i.ime_keten,1,i.ime_relatienr,i.ime_ketennr) from :1 p, :2 i where p.ip_relatie = 0 and p.ip_provisie_soort = 5 and /*alleen niet afgehandelde arrangementsprovisies*/ p.ip_afhandelingsdatum = '00000000' and p.ip_afhandelingsnr = 0 and i.ime_relatienr = p.ip_intermediar and /*de arrangementsprovisie moet geboekt zijn */ p.ip_transacitievolgnr <> 0 and
/*Controle als de intermediair geen keten is */ ((i.ime_keten = 0 and (~3=0 or (~3=1 and i.ime_ketennr between ~4 and ~5))) or /*Controle als de intermediair een keten is */ (i.ime_keten = 1 and (~3=0 or (~3=1 and i.ime_relatienr between ~4 and ~5))))
